pub fn get_tsql_root_grammar_id() -> GrammarId {
    GrammarId(3314)
}
pub fn get_tsql_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_tsql_root_grammar_id(),
        tables: &TSQL_TABLES,
    }
}
pub fn get_tsql_root_grammar() -> RootGrammar {
    get_tsql_root_grammar_table()
}
